query BlogIndexQuery {
  allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/posts/"}}, sort: {fields: frontmatter___date, order: DESC}) {
    edges {
      node {
        id
        frontmatter {
          title
          date
          slug
          frontPhoto {
            childImageSharp {
              fluid(maxWidth: 1200) {
                aspectRatio
                sizes
                src
                srcSet
              }
            }
          }
        }
        excerpt(pruneLength: 300)
      }
    }
  }
}

